import React from "react";

class Home extends React.Component {
    constructor(props) {
        super(props);

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange() {
        window.alert("test");
    }

    handleSubmit(event) {
        alert('Your favorite flavor is: ' + this.state.value);
    }

    render() {
        return (
            <div>
                <h2 className="text-center text-white">Logget inn som: <b>[Username]</b></h2>
                <br></br>
                <div className="d-flex flex-row bd-highlight mb-2 justify-content-center">
                    <div className="p-2">
                        <button onChange={this.handleChange()} type="button" className="home-button btn btn-primary btn-lg">Ny melding</button>
                    </div>
                    <div className="p-2">
                        <button type="button" className="home-button btn btn-primary btn-lg">Aktive meldinger</button>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
